const staticData = getWorkflowStaticData('global');
const newListingIds = items.map(item => item.json["id"]);
const oldListingIds = staticData.oldListingIds; 

if (!oldListingIds) {
  staticData.oldListingIds = newListingIds;
  return items;
}


const ActualNewListingIds = newListingIds.filter((id) => !oldListingIds.includes(id));
const actualNewListing = items.filter((data) => ActualNewListingIds.includes(data.json['id']));
staticData.oldListingIds = [...ActualNewListingIds, ...oldListingIds];

return actualNewListing;

